$(document).ready(function () {
  function makeAbsolute(url) {
    var a = document.createElement('a');
    a.href = url;
    return a.href;
  }

  if (OSM.oauth_token) {
    var headerGenerator = window.ohauth.headerGenerator({
      consumer_key: OSM.oauth_consumer_key,
      consumer_secret: OSM.oauth_consumer_secret,
      token: OSM.oauth_token,
      token_secret: OSM.oauth_token_secret
    });

    $.ajaxPrefilter(function(options, jqxhr) {
      if (options.oauth) {
        options.headers = options.headers || {};
        options.headers.Authorization = headerGenerator(options.type, makeAbsolute(options.url), jqxhr.data);
      }
    });
  }
});
if (OSM.PIWIK) {
  $(document).ready(function () {
    var base = document.location.protocol + "//" + OSM.PIWIK.location + "/";
    var piwikTracker;

    var piwikLoader = $.ajax({
      url: base + "piwik.js",
      dataType: "script",
      cache: true,
      success: function () {
        piwikTracker = Piwik.getTracker(base + "piwik.php", OSM.PIWIK.site);
      
        if (OSM.user) {
          piwikTracker.setUserId(OSM.user.toString());
        }

        piwikTracker.trackPageView();
        piwikTracker.enableLinkTracking();
      
        $("meta[name=piwik-goal]").each(function () {
          piwikTracker.trackGoal($(this).attr("content"));
        });
      }
    });

    $("body").on("piwikgoal", function (e, goal) {
      piwikLoader.done(function () {
        piwikTracker.trackGoal(goal);
      });
    });
  });
}
